import './App.css';

function App() {
    return (
        <section id="calculator">
            <div>
                <div>Bill</div>
                <div>Select Tip</div>
                <div>Number</div>
            </div>
            <div>
                <div>Tip Amount</div>
                <div>Total</div>
                <button>Reset</button>
            </div>
        </section>
    );
}

export default App;
